import './App.css';
import { Route, Switch } from "react-router-dom";
import UserInfo from "./Components/UserInfo"
import Sample from "./Components/Sample"

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/UserInfo">
          <UserInfo />
        </Route>
        <Route path="/Sample">
          <Sample />
        </Route>
      </Switch>

    </div>
  );
}

export default App;
